import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import * as serviceWorker from './serviceWorker';
import config from './config/constants';
import Amplify, { Auth } from 'aws-amplify';
import { Provider } from 'react-redux';
import store from './store';
import { transitions, positions, Provider as AlertProvider } from 'react-alert';

const COMMON = {
  region: config.COGNITO.REGION,
  custom_header: async () => {
    return {
      Authorization: (await Auth.currentSession()).idToken.jwtToken
    };
  }
};

const options = {
  position: positions.MIDDLE,
  timeout: 2500,
  offset: '30px',
  transition: transitions.SCALE
}

const LightBox = props => {
  const {
    link = "link",
    title = "Titulo da lightBox",
    children = "Texto da lightBox",
    btnText = "Texto do botão"
  } = props;



  return (
    <>
      <div className="link" onClick={abrir}>
        <p className="linkStyle">{link}</p>
      </div>
      <div style={open} className="opacity"></div>
      <div style={open} className="box">
        <h3 className="title">{title}</h3>
        <div className="text">{children}</div>
        <button className="btn" onClick={fechar}>
          {btnText}
        </button>
      </div>
    </>
  );
};

const AlertTemplate = ({ style, message }) => (
  <>
  <div style={{
    display: "Block",
    position: "fixed",
    top: "0",
    left: "0",
    bottom: "0",
    background: "rgba(0, 0, 0, 0.8)",
    height: "100%",
    width: "100%",
    zIndex: "10"
  }}></div>
  <div style={{
    display: "block",
    position: "fixed",
    top: "50%",
    left: "50%",
    transform: "translate(-50%, -50%)",
    maxWidth: "740px",
    minWidth: "260px",
    maxHeight: "550px",
    minHeight: "320px",
    borderRadius: "4px",
    backgroundColor: "#f9f9f9",
    overflowY: "scroll",
    color: "#444444",
    zIndex: "10"
  }}>
    {message}
    <button>X</button>
  </div>
  </>
)

Amplify.configure({
  Auth: {
    region: config.COGNITO.REGION,
    userPoolId: config.COGNITO.USER_POOL_ID,
    userPoolWebClientId: config.COGNITO.APP_CLIENT_ID
  },
  API: {
    endpoints: [
      {
        name: config.APIS.PLAYERSTARS,
        endpoint: config.DOMAIN,
        ...COMMON
      }
    ]
  }
});

ReactDOM.render(
  <Provider store={store}>
    <AlertProvider template={AlertTemplate} {...options}>
      <App />
    </AlertProvider>
  </Provider>, document.getElementById('root'));

serviceWorker.unregister();
